import './About.css'


const About = () => {
    
    return (
        <section>
            <h2>About</h2>
            <p>This is my playlist, made by (Me, Myself and I) as a project for Winc Academy. 
                Made with love and hard work, pffff. <br/> 
                You can see I like a lot of music styles.<br/>
                You can add or remove songs, but this is my list!!
            </p>
        </section>
    )
}

export default About
